import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {

  const names = ['Mr.a','Mr.b','Mr.c']
  return (
    <div className="App">

      <Users name="Mr.x" age="55"></Users>
      <Users name="Mr.y"></Users>
      <Users name={names[0]}></Users>
      <Users name={names[1]}></Users>





      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
      </header>
    </div>
  );
}

function Users(props){ // data pass korar jonno props use kora hoi
  const userStyle = {
    border: '1px solid gray',
    borderRadius:'5px',
    backgroundColor: 'lightgreen',

  }
  return(
    <div style={userStyle}>
      <h4>Users Name: {props.name}</h4>
      <h4>Users age:I have done 5 movies in {props.age || 40} years</h4>
    </div>
  )
}

export default App;
